import styled, { createGlobalStyle } from 'styled-components'

export const GlboalStyle = createGlobalStyle`
* {
margin: 0;
padding: 0;
box-sizing: border-box;
font-family: Roboto, sans-serif;
list-style-type: none;
}
`

export default GlboalStyle
